import React, { useState } from 'react';
import { View, Text, Image, StyleSheet, Pressable, ActivityIndicator, ImageSourcePropType } from 'react-native';
import { Feather } from '@expo/vector-icons';
import { fallbackThumbnail } from '../../assets/images';

interface CourseCardProps {
  title: string;
  category: string;
  duration: string;
  rating: number;
  thumbnail: ImageSourcePropType;
  description?: string;
  onPress: () => void;
}

export const CourseCard = ({ 
  title, 
  category, 
  duration, 
  rating, 
  thumbnail, 
  description,
  onPress 
}: CourseCardProps) => {
  const [isLoading, setIsLoading] = useState(true);
  const [imageError, setImageError] = useState(false);

  const handleImageError = () => {
    setImageError(true);
    setIsLoading(false);
  };

  return (
    <Pressable 
      style={({ pressed }) => [
        styles.card,
        pressed && styles.cardPressed
      ]} 
      onPress={onPress}
    >
      <View style={styles.thumbnailContainer}>
        <Image
          source={imageError ? fallbackThumbnail : thumbnail}
          style={styles.thumbnail}
          resizeMode="cover"
          onLoadStart={() => setIsLoading(true)}
          onLoadEnd={() => setIsLoading(false)}
          onError={handleImageError}
        />
        {isLoading && (
          <View style={styles.loadingContainer}>
            <ActivityIndicator size="small" color="#7C3AED" />
          </View>
        )}
        <View style={styles.thumbnailOverlay} />
        <View style={styles.durationBadge}>
          <Feather name="clock" size={12} color="#FFF" />
          <Text style={styles.durationText}>{duration}</Text>
        </View>
      </View>
      <View style={styles.content}>
        <View style={styles.categoryContainer}>
          <Text style={styles.category}>{category}</Text>
        </View>
        <Text style={styles.title} numberOfLines={2}>{title}</Text>
        {description && (
          <Text style={styles.description} numberOfLines={2}>
            {description}
          </Text>
        )}
        <View style={styles.footer}>
          <View style={styles.rating}>
            <Feather name="star" size={14} color="#FFB800" />
            <Text style={styles.ratingText}>{rating.toFixed(1)}</Text>
          </View>
          <View style={styles.learnMore}>
            <Text style={styles.learnMoreText}>Learn More</Text>
            <Feather name="arrow-right" size={14} color="#7C3AED" />
          </View>
        </View>
      </View>
    </Pressable>
  );
};

const styles = StyleSheet.create({
  card: {
    backgroundColor: 'white',
    borderRadius: 16,
    overflow: 'hidden',
    marginBottom: 20,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 4 },
    shadowOpacity: 0.1,
    shadowRadius: 8,
    elevation: 4,
    width: '100%',
    maxWidth: 340,
    transform: [{ scale: 1 }],
  },
  cardPressed: {
    transform: [{ scale: 0.98 }],
    shadowOpacity: 0.05,
  },
  thumbnailContainer: {
    position: 'relative',
    height: 180,
    backgroundColor: '#F3F4F6',
  },
  loadingContainer: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F3F4F6',
  },
  thumbnail: {
    width: '100%',
    height: '100%',
    backgroundColor: '#F3F4F6',
  },
  thumbnailOverlay: {
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
    height: '50%',
    backgroundColor: 'rgba(0, 0, 0, 0.3)',
  },
  durationBadge: {
    position: 'absolute',
    bottom: 12,
    right: 12,
    backgroundColor: 'rgba(0, 0, 0, 0.75)',
    paddingHorizontal: 10,
    paddingVertical: 6,
    borderRadius: 6,
    flexDirection: 'row',
    alignItems: 'center',
    zIndex: 1,
  },
  durationText: {
    color: '#FFF',
    fontSize: 12,
    fontWeight: '500',
    marginLeft: 6,
  },
  content: {
    padding: 16,
  },
  categoryContainer: {
    marginBottom: 8,
  },
  category: {
    color: '#7C3AED',
    fontSize: 13,
    fontWeight: '600',
    textTransform: 'uppercase',
    letterSpacing: 0.5,
  },
  title: {
    fontSize: 17,
    fontWeight: '700',
    color: '#1F2937',
    marginBottom: 8,
    lineHeight: 24,
  },
  description: {
    fontSize: 14,
    color: '#6B7280',
    lineHeight: 20,
    marginBottom: 12,
  },
  footer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginTop: 4,
  },
  rating: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: '#FFF9E5',
    paddingHorizontal: 8,
    paddingVertical: 4,
    borderRadius: 6,
  },
  ratingText: {
    color: '#B45309',
    fontSize: 13,
    fontWeight: '600',
    marginLeft: 4,
  },
  learnMore: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  learnMoreText: {
    color: '#7C3AED',
    fontSize: 13,
    fontWeight: '600',
    marginRight: 4,
  },
});
